var tipuesearch = {"pages": [{'title': 'About', 'text': '此內容管理系統以\xa0 https://github.com/mdecourse/cmsimde \xa0作為 submodule 運作, 可以選定對應的版本運作, cmsimde 可以持續改版, 不會影響之前設為 submodule, 使用舊版 cmsimde 模組的內容管理相關運作. \n 利用 cmsimde 建立靜態網誌方法: \n 1. 在 github 建立倉儲, git clone 到近端 \n 2. 參考\xa0 https://github.com/mdecourse/newcms , 加入除了 cmsimde 目錄外的所有內容 \n 以 git submodule add\xa0 https://github.com/mdecourse/cmsimde \xa0cmsimde \n 建立 cmsimde 目錄, 並從 github 取下子模組內容. \n 3.在近端維護時, 更換目錄到倉儲中的 cmsimde, 以 python wsgi.py 啟動近端網際伺服器. \n 動態內容編輯完成後, 以 generate_pages 轉為靜態內容, 以 git add commit 及 push 將內容推到遠端. \n 4. 之後若要以 git clone 取下包含 submodule 的所有內容, 執行: \n git clone --recurse-submodules  https://github.com/mdecourse/newcms.git \n', 'tags': '', 'url': 'About.html'}, {'title': 'Develop', 'text': 'https://github.com/mdecourse/cmsimde \xa0的開發, 可以在一個目錄中放入 cmsimde, 然後將 up_dir 中的內容放到與 cmsimde 目錄同位階的地方, 使用 command 進入 cmsimde 目錄, 執行 python wsgi.py, 就可以啟動, 以瀏覽器 https://localhost:9443\xa0就可以連接, 以 admin 作為管理者密碼, 就可以登入維護內容. \n cmsimde 的開發採用 Leo Editor, 開啟 cmsimde 目錄中的 cmsimde.leo 就可以進行程式修改, 結束後, 若要保留網際內容, 只要將 cmsimde 外部的內容倒回 up_dir 目錄中即可後續對 cmsimde 遠端倉儲進行改版. \n init.py 位於\xa0 up_dir 目錄, 可以設定 site_title 與 uwsgi 等變數. \n', 'tags': '', 'url': 'Develop.html'}, {'title': '直播內容', 'text': '', 'tags': '', 'url': '直播內容.html'}, {'title': 'W2', 'text': '直播影片 \n https://www.youtube.com/watch?v=JXUKf0cfJcc \n', 'tags': '', 'url': 'W2.html'}, {'title': 'W3', 'text': '直播影片 \n https://www.youtube.com/watch?v=QTfPD5bpeKc&feature=emb_title \n', 'tags': '', 'url': 'W3.html'}, {'title': 'W5', 'text': '直播影片 \n https://www.youtube.com/watch?v=ElNea4b1dX8', 'tags': '', 'url': 'W5.html'}, {'title': 'Webots tutorial 翻譯內容', 'text': '', 'tags': '', 'url': 'Webots tutorial 翻譯內容.html'}, {'title': 'Propeller', 'text': '螺旋槳 \n \n Description 描述 \n The\xa0 Propeller \xa0node can be used to model a marine or an aircraft propeller. When its\xa0device\xa0field is set with a\xa0 RotationalMotor , the propeller turns the motor angular velocity into a thrust and a (resistant) torque. The resultant thrust is the product of a real number T by the unit length shaft axis vector defined in the\xa0shaftAxis\xa0field, with T given by the formula: \n 螺旋槳節點可用於對海軍陸戰隊或飛機螺旋槳建模。 當其設備字段設置為 RotationalMotor 時，螺旋槳會將電動機角速度轉換為推力和（阻力）轉矩。 合成推力是實數 T 與 shaftAxis 字段中定義的單位長度軸軸線矢量的乘積，其中 T 由下式給出： \n \n Where t1 and t2 are the constants specified in the\xa0thrustConstants\xa0field, omega is the motor angular velocity and V is the component of the linear velocity of the center of thrust along the shaft axis. The thrust is applied at the point specified within the\xa0centerOfThrust\xa0field. The resultant torque is the product of a real number Q by the unit length shaft axis vector, with Q given by the formula: \n 其中 t1 和 t2 是推力常數字段中指定的常數，ω是電動機角速度， V 是推力中心沿軸心的線速度的分量。 推力施加在 centerOfThrust 字段內指定的點上。 合成轉矩是實數 Q 與單位長度軸軸線矢量的乘積， Q 由下式給出： \n \n Where q1 and q2 are the constants specified in the\xa0torqueConstants\xa0field. \n 其中 q1 和 q2 是 torqueConstants 字段中指定的常數。 \n The above formulae are based on "Guidance and Control of Ocean Vehicles" from Thor I. Fossen and "Helicopter Performance, Stability, and Control" from Raymond W. Prouty. \n \xa0以上公式基於 Thor I. Fossen 的“海洋車輛的指導和控制”和 Raymond W. Prouty 的“直升機性能，穩定性和控制”。 \n Theexample"propeller.wbt"locatedinthe "projects/samples/devices/worlds" directory of Webots shows three different helicopters modeled with\xa0 Propeller \xa0nodes. \n 位於 Webots 的“  projects / samples / devices / worlds ”目錄中的示例“  propeller.wbt ”顯示了用 Propeller 節點建模的三種不同的直升機。 \n Field Summary 領域摘要 \n \n shaftAxis :  defines the axis along which the resultant thrust and torque will be exerted, see\xa0 this figure . \n shaftAxis ： 定義將沿其施加合成推力和扭矩的軸線，請參見此圖 \n centerOfThrust :  defines the point where the generated thrust applies, see\xa0 this figure . \n centerOfThrust ： 定義生成的推力施加的點，請參見此圖。 \n thrustConstants and\xa0 torqueConstants :  coefficients used to define the resultant thrust and torque as functions of the motor angular velocity and the linear speed of adavance, see above formulae. \n 推力常數和轉矩常數： 用於定義合成推力和轉矩作為電動機角速度和直線速度的函數的係數，請參見上式。 \n fastHelixThreshold :  threshold in\xa0[rad/s]from which the helix representation is switched from\xa0slowHelix\xa0tofastHelix. The default value equals to 24π\xa0[rad/s]. \n fastHelixThreshold ： 閾值，以 [rad / s] 為單位，從該閾值將螺旋表示形式從 slowHelix 切換到 fastHelix 。 默認值等於 24 π [rad / s] 。 \n device :  this field has to be set with a\xa0 RotationalMotor in order to control the propeller. \n 設備： 必須使用 RotationalMotor 設置此字段才能控制螺旋槳。 \n fastHelix and\xa0 slowHelix : if not NULL, these fields must be set with\xa0 Solid  The corresponding\xa0 Solid \xa0nodes define the graphical representation of the propeller according to its motor\'s angular velocity omega: if\xa0|omega| >fastHelixThreshold, only the\xa0 Solid \xa0defined in\xa0fastHelix\xa0is visible, otherwise only the\xa0 Solid \xa0defined in\xa0slowHelix\xa0is visibler. \n fastHelix 和 slowHelix ： 如果不為 NULL ，則必須使用實體節點設置這些字段。 相應的實體節點根據螺旋槳的電動機角速度ω定義螺旋槳的圖形表示： if | omega | >fastHelixThreshold ，僅在 fastHelix 中定義的實體可見，否則僅在 slowHelix 中定義的實體可見。 \n', 'tags': '', 'url': 'Propeller.html'}, {'title': 'RotationalMotor', 'text': '旋轉馬達 \n Derived from\xa0 Motor . \n 源自 電機 。 \n \n Description 描述 \n A\xa0 RotationalMotor \xa0 node can be used to power either a \xa0 HingeJoint \xa0or a\xa0 Hinge2Joint \xa0to produce a rotational motion around the choosen axis. \n RotationalMotor 節點可用於為 HingeJoint 或 Hinge2Joint 供電，以產生圍繞所選軸的旋轉運動。 \n \n Field Summary 領域摘要 \n \n The\xa0namefield specifies the name identifier of the motor device. This the name to which the\xa0wb_robot_get_device\xa0function refer. It defaults to\xa0"rotational motor" \n 名稱字段指定電機設備的名稱標識符。  wb_robot_get_device 函數引用的名稱。 默認為“旋轉電機”。 \n The\xa0maxTorquefield specifies both the upper limit and the default value for the motor\xa0 available torque . The\xa0 available torque \xa0is the torque that is available to the motor to perform the requested motions. It is expressed in\xa0 newton meter \xa0[N⋅m]. The\xa0wb_motor_set_available_torque\xa0function can be used to change the\xa0 available torque \xa0at run-time. The value of\xa0maxTorque\xa0should always be zero or positive (the default value is 10 N⋅m). A small\xa0maxTorque\xa0value may result in a motor being unable to move to the target position because of its weight or other external forces. \n maxTorque字段同時指定了電動機可用轉矩的上限和默認值。可用轉矩是電動機可用於執行請求的運動的轉矩。用牛頓米 [N·m] 表示。 wb_motor_set_available_torque 函數可用於在運行時更改可用轉矩。 maxTorque 的值應始終為零或正（默認值為 10N ⋅m）。較小的 maxTorque 值可能會導致電動機由於其重量或其他外力而無法移動到目標位置。 \n', 'tags': '', 'url': 'RotationalMotor.html'}, {'title': 'Speaker', 'text': '', 'tags': '', 'url': 'Speaker.html'}, {'title': 'Track', 'text': '', 'tags': '', 'url': 'Track.html'}, {'title': '每週進度', 'text': '', 'tags': '', 'url': '每週進度.html'}, {'title': 'week1', 'text': '創建個人倉儲及架設網站 \n (1)CD2020個人倉儲 \n \n (2)cmsimde網站 \n \n \n', 'tags': '', 'url': 'week1.html'}, {'title': 'week2', 'text': '組長創建小組倉儲 https://github.com/s40723155/cd2020-ag1 ，個組員進行Fork \n \n 小組長亂數分組，分配各項工作給組員 \n \n \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '更新python3.8.2 \n 1.輸入網址 https://www.python.org/downloads/release/python-382/ \n 2.下載檔案 Windows x86-64 executable installer \n 3. 完成後開啟下載的檔案，選擇Customize installation選項 \n \n 4. 不勾選pip，接續按下next \n \n 5.選擇路徑將python安裝至可攜式系統中的Y槽下 \n 6.開啟start_mdecourse.bat批次檔 \n 7.將 start_mdecourse.bat批次檔中的py373改為安裝python 3.8.2版本的資料夾 \n 8. 將安裝之資料夾取名為py382 \n \n 執行stop.bat批次檔後重新啟動start_mdecourse(為了讓檔案重新讀取) \n 9.輸入get-pip.py，開始安裝pip工具 \n 10.安裝cmsimde所需模組 \n \n 11.進行檢驗是否更新至\xa0 python 3.8.2 \n \n', 'tags': '', 'url': 'week3.html'}, {'title': 'week5', 'text': '\n \n', 'tags': '', 'url': 'week5.html'}]};